INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 7, 7001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 7, 7002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 7, 7003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 10, 10001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 10, 10002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 10, 10003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 10, 10004, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 12, 12001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -416.5, 0, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 13, 13001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 13, 13002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 13, 13003, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 13, 13004, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 14, 14001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 14, 14002, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 14, 14003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 14, 14004, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 15, 15001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -470.0, 0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 16, 16001, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 16, 16002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 16, 16003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 16, 16004, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 17, 17002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 25, 17004, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 25, 17005, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 25, 17006, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 25, 17007, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 18, 18001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 18, 18002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 2, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 19, 19001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -470.0, 0, 3, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 19, 19002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -470.0, 0, 4, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 20, 20001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -470.0, 0, 5, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 20, 20002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -470.0, 0, 6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 21, 21001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "キャル", 106001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 21, 21002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 21, 21003, "2015/12/17 15:00:00", 1, 2104010, "2030/12/17 14:59:59", -363.0, 0, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "シェフィ", 106401, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 21, 21004, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "ペコリーヌ", 105801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 22, 22001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -430.0, 0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 22, 22002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -430.0, 0, 2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 23, 23001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -430.0, 0, 3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 23, 23002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -430.0, 0, 4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "カリン", 190801, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4.08, 24, 24001, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 109001, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5.0, 24, 24002, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 109001, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10.11, 24, 24003, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 109001, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4.0, 24, 24004, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 109001, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (6.0, 24, 24005, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 109001, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24006, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 109002, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24007, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 109002, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24008, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 109002, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24009, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 109002, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24010, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 109002, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2.12, 24, 24011, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 109101, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (4.19, 24, 24012, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 109101, 8.0, 5);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (2.3, 24, 24013, "2019/01/31 12:00:00", 4, 0, "2030/12/17 14:59:59", -385.0, 10011, 3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 109101, 8.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24014, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 109102, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5.23, 24, 24015, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 109101, 8.0, 5);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24016, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 109102, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5.01, 24, 24017, "2019/01/31 12:00:00", 2, 0, "2030/12/17 14:59:59", -385.0, 10011, 7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 109101, 8.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24018, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 109102, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24019, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 109102, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 24, 24020, "2019/01/31 12:00:00", 1, 0, "2030/12/17 14:59:59", 0.0, 10011, 10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 109102, 0.0, 1);
