INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 26, 26003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "キャル", 106001, 0.0, 1);
