INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 43, 43002, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "コッコロ", 105901, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 43, 43003, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -363.0, 0, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "キャル", 106001, 0.0, 1);
