INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 44, 43005, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -416.5, 0, 2, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "アメス", 123001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (5.79, 45, 43006, "2015/12/17 15:00:00", 2, 0, "2030/12/17 14:59:59", -416.5, 0, 3, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "アメス", 123001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 46, 46001, "2015/12/17 15:00:00", 1, 0, "2030/12/17 14:59:59", -371.5, 0, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "アメス", 123001, 0.0, 1);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0.0, 47, 47001, "2015/12/17 15:00:00", 2, 0, "2030/12/17 14:59:59", -416.5, 0, 1, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "シズル", 104901, 0.0, 2);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (9.32, 47, 47002, "2015/12/17 15:00:00", 2, 0, "2030/12/17 14:59:59", -416.5, 0, 1, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", "リノ", 101101, 0.0, 1);
